/* eslint-disable import/prefer-default-export */
import styled from 'styled-components';

export const Input = styled.input`
    display: flex;
    justify-content: center;
    align-items: center;
    float:left;
    max-height: 32px;
    min-height: 32px;

    width: 600px;
    border:1px solid aqua;
    border-radius:5px;
    margin:3px 2px;
    padding: 0 9px;
    }
`;
